import { type } from '../action';

const initialState = {
  sd: '',
  pw: ''
}

export default (state = initialState, action)=>{
  switch (action) {
    case type.STUDENT_DATA:
      return{
        ...state,
        studentID: '',
        studentPassword: '',
      };
      break;
    default:
      break;
  }
}
